import numpy as np
import random

edges = {}
file = open("GC_Dataset/gcol1.txt", "r")
for line in file.readlines()[1:-1]:
    line = line.split()
    if int(line[1]) in edges:
        edges[int(line[1])].append(int(line[2]))
    else:
        edges[int(line[1])] = []
        edges[int(line[1])].append(int(line[2]))

    if int(line[2]) in edges:
        edges[int(line[2])].append(int(line[1]))
    else:
        edges[int(line[2])] = []
        edges[int(line[2])].append(int(line[1]))
file.close()

data = {}
num_keys = len(edges.keys())
data['num_keys'] = num_keys
max_degree = max(len(item) for item in edges.values())
data['max_degree'] = max_degree

adj_matrix = []
for i in range(num_keys):
    adj_matrix.append([0 for i in range(num_keys)])

for key in edges:
    for nodes in edges[key]:
        adj_matrix[key-1][nodes-1] = 1

def check_chromosome(chromosome:list) -> bool:
    # iterates over all the color of each node
    for i in range(len(chromosome)):
        # iterates over all adjacent nodes
        for j in edges[i + 1]:
            if chromosome[i] == chromosome[j-1] and adj_matrix[i] == adj_matrix[j-1]:
                return False
    return True

